import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Mapa from './components/maps/Mapa';
import datosGeoJSON from './components/maps/datosGeoJSON';
import VehicleForm from './components/vehicle/vehicle';
import VehicleList from './components/vehicle/vehicleList';
import MenuBar from './components/menu/menuBar';

function App() {
  return (
    <Router>
      <div>
        <MenuBar />
        <div className="App" style={{ display: 'flex', flexDirection: 'row' }}>
          <div style={{ flex: '1', minWidth: '40%' }}>
            <Switch>
              <Route path="/vehicle-form" component={VehicleForm} />
              <Route path="/" component={VehicleList} />
            </Switch>
          </div>
          <div style={{ flex: '1', minWidth: '60%' }}>
            <Switch>
              <Route path="/vehicle-form" component={VehicleForm} />
              <Route path="/" component={() => <Mapa datosGeoJSON={datosGeoJSON} />} />
            </Switch>
          </div>
        </div>
      </div>
    </Router>
  );
}

export default App;
